        bio:
          'James J. Hodge (Ph.D. University of Chicago) is an Assistant Professor in the department of English and the Alice Kaplan Institute for the Humanities. He specializes in new media studies, especially digital media aesthetics. He also researches and teaches courses in critical theory, cinema and media studies, media theory and history, electronic literature, animation, experimental film and media, and science and technology studies.\n\nBefore coming to Northwestern, Hodge was a Postdoctoral Associate at Duke University in association with a Mellon-funded Sawyer Seminar entitled "Phenomenology, Minds, and Media." He received his BA from Oberlin College and his MA from the University of California, Santa Barbara.',
