        bio:
          "Reyes Morn Fuertes is a Lecturer in Northwestern's Department of Spanish and Portuguese. In her native Spain, Reyes studied at the Universidad de Salamanca, one of Europe's four oldest universities, where she specialized in Spanish Philology. After completing her undergraduate studies, Reyes continued in Salamanca with post graduate work in the field of Teaching Spanish as a Second Language and went on to teach in Cursos Internacionales, the Universidad de Salamanca's Spanish language department for non-native Spanish students. In 2006 she completed a master's degree in Hispanic Studies in UIC. Outside the classroom, Reyes plans to pursue research in the area of Spanish language and grammar. Her goal is to research complex linguistic and grammatical phenomenon, and distill them into simpler forms which can be easily taught to non-native students of Spanish.",
